import React from 'react';
import Head from 'next/head';
import Layout from '../components/Layout';

const Home = () => {
    return(
        <>
            <div class="Top">
            <Layout>
                <Head>
                    <title>About</title>
                </Head>         
            </Layout>
            </div>
            <h1>Home</h1> 
        <style jsx>{`
            .Top{
                height: 5em;
                background: red;
            }
            
               
            
            `}</style>
        </>
    )
}
export default Home;
